#' @importFrom rmarkdown latex_dependency
#' @importFrom knitr knit_meta_add
style_wrapper_tex <-
  function(styling,
           type = c("text", "style", "background"),
           method = print_method()) {
    if (is.na(styling)) {
      function(x) {
        x
      }
    } else{
      type <- match.arg(type)
      styling <- tolower(styling)
      switch(
        type,
        "text" = tex_text_styling(unify_colors(styling, type = "latex")),
        "style" = tex_decoration_styling(styling,method),
        "background" = tex_background_styling(unify_colors(styling, type = "latex"))
      )
    }
  }


tex_decoration_styling <- function(styling,method){
  if (!styling %in% names(latex_style_codes)) {
    function(x){x}
  }else{
    codes <- latex_style_codes[[styling]]
    if (!is.null(codes[["package"]])) {
      if(method == "beamer"){
        return(function(x){x})
      }else{
        add_tex_package(codes[["package"]], codes[["options"]], codes[["extra_lines"]])
      }
    }
    wrapper <- paste0(codes$code ,"{")
    function(x){
      paste0(wrapper,x,"}")
    }
  }
}

tex_text_styling <- function(color){
  codes <- try(find_tex_codes(color), silent = TRUE)
  if (inherits(codes, "try-error")) {
    function(x) {
      x
    }
  } else{
    wrapper <- paste0("\\textcolor[rgb]{",codes$code2,"}{")
    function(x) {
        paste0(wrapper,x,"}")
    }
  }
}

tex_background_styling <- function(color){
  codes <- try(find_tex_codes(color),silent = TRUE)
  if (inherits(codes, "try-error")) {
    function(x) {
      x
    }
  } else{
    wrapper <- paste0("\\colorbox[rgb]{",gsub(" ","",codes$code2,fixed=TRUE),"}{")
    function(x) {
      paste0(wrapper,x,"}")
    }
  }
}

tex_code_idx <- function(color) {
  if (grepl("^#", color) & grepl("^#[0-9A-F]{6}$", color, perl = TRUE)) {
    valid <- which(color_key_latex$hex %in% color)
  } else {
    valid <- which(color_key_latex$Name %in% color)
  }
  if (length(valid) > 1) {
    valid <- min(valid)
  }
  return(valid)
}


#' @importFrom grDevices col2rgb
find_tex_codes <- function(input){
  idx <- tex_code_idx(input)
  if (identical(idx,integer())) {

    rgb_mat <- col2rgb(input)[,1, drop = TRUE]
    rgb_key <- do.call('rbind',color_key_latex$RGB)
    idx <- which_closest_color(rgb_mat, rgb_key)
  }

  c(color_key_latex[idx,c("Name","code","code2")])
}

latex_style_codes <- list(
  bold = list(code = "\\textbf"),
  italic = list(code = "\\textit"),
  underline = list(code = "\\underline"),
  strikethrough = list(code = "\\sout", package = "ulem"),
  outline = list(code = "\\contour{black}", package = "contour", options = "pdftex,outline")
)

add_tex_package <- function(package, options = NULL, extra_lines = NULL){
  id <- do.call('c',lapply(knitr::knit_meta(clean = FALSE),`[[`,"name"))
  if(!package %in% id){
    knitr::knit_meta_add(list(
      rmarkdown::latex_dependency(
        name = package,
        options = options,
        extra_lines = extra_lines)))
  }
}

